$(function(){$(".send-btn").on("tap",function(){var b=$("form").serialize();var a=sn.mySerialize(b);window.mobile=a.mobile;if(a.mobile.length==0){mui.toast("手机号不能为空");return}sn.vCode($(".send-btn"),a.mobile)});$(".reg-btn").on("tap",function(){var b=$("form").serialize();var a=sn.mySerialize(b);if(window.mobile!==a.mobile){mui.toast("验证码错误");return}if(a.username.length==0){mui.toast("用户名不能为空");return}if(a.password.length==0){mui.toast("密码不能为空");return}if(a.mobile.length==0){mui.toast("手机号不能为空");return}if(a.vCode.length==0){mui.toast("验证码不能为空");return}if(window.mobile!==a.mobile){mui.toast("验证码错误");return}$.ajax({type:"post",url:"/api/user/register",datType:"json",data:b,success:function(c){if(c.success){if(location.search&&location.search.indexOf("?returnUrl=")>-1){var d=location.search.replace("?returnUrl=","");location.href=d}else{location.href="/suning/index.html"}}else{mui.toast(c.message)}}})})});